/**
 * @param {number} m
 * @param {number} k
 */
var MKAverage = function(m, k) {
    this.m = m
    this.k = k
    this.queue = new MyQueue()
    this.index = 0
    // let currIndex = 0
    this.minHeap = new Heap({comparator: (a, b) => a[0] < b[0]})
    this.maxHeap = new Heap({comparator: (a, b) => a[0] > b[0]})
};

/** 
 * @param {number} num
 * @return {void}
 */
MKAverage.prototype.addElement = function(num) {
    // this.queue.enqueue([num, this.index])
    this.minHeap.push([num, this.index])
    this.maxHeap.push([num, this.index])
    this.index+=1
    // if(this.queue.getSize()>this.m) this.queue.dequeue()
};

/**
 * @return {number}
 */
MKAverage.prototype.calculateMKAverage = function() {
    if(this.index < this.m) return -1
    while(this.minHeap.getSize()>0 && this.minHeap.peek()[1] <= this.index-this.m) this.minHeap.pop()
    while(this.maxHeap.getSize()>0 && this.maxHeap.peek()[1] <= this.index-this.m) this.maxHeap.pop()

    // let queueFront = this.queue.getFront()
    // for(let i=0; i<this.m; i++) {
    //     const ele = this.queue.getElementFromIndex(queueFront++)
    //     this.minHeap.push(ele)
    //     this.maxHeap.push(ele)
    // }
    let removed = {}
    for(let j=0; j<this.k; j++) {
        if(this.minHeap.getSize()>0) {
            const poppedMin = this.minHeap.pop()
            removed[poppedMin[1]] = true
        }
        if(this.maxHeap.getSize()>0) {
            const poppedMax = this.maxHeap.pop()
            removed[poppedMax[1]] = true
        }
    }
    let sum = 0
    let considered = {}
    let noOfElements = 0
    while(this.minHeap.getSize() > 0) {
            const ele = this.minHeap.pop()
            if(removed[ele[1]] === undefined) {
                sum+=ele[0]
                noOfElements+= 1
                considered[ele[1]] = true
            }

    }
    while(this.maxHeap.getSize() > 0) {
        const ele = this.maxHeap.pop()
        if(removed[ele[1]]===undefined && considered[ele[1]]===undefined) {
            sum+=ele[0]
            noOfElements+= 1
            considered[ele[1]] = true
        }
    }
    return Math.floor(sum/noOfElements)
};

/** 
 * Your MKAverage object will be instantiated and called as such:
 * var obj = new MKAverage(m, k)
 * obj.addElement(num)
 * var param_2 = obj.calculateMKAverage()
 */

function takeInput(inputString, input) {
    let mk = new MKAverage(...input[0])
    let output = [null]
    for(let i=1 ;i<input.length; i++) {
        switch(inputString[i]) {
            case 'addElement':
                mk.addElement(input[i])
                output.push(null)
                continue
            case 'calculateMKAverage':
                output.push(mk.calculateMKAverage())
                continue
            default:
                continue
        }
    }
    console.log("JSON", JSON.stringify(output))
    return output
}

